                    "text@id": { S: "658c1bd3c39bb10008431b5b#0001" },
                    "text@title": { S: "Welcome to Webiny" },
                    "boolean@locked": { BOOL: true },
                    "datetime@createdOn": { S: "2023-12-27T12:42:59.947Z" },
                    "text@status": { S: "published" },
                    "text@path": { S: "/welcome-to-webiny" },
                    "text@pid": { S: "658c1bd3c39bb10008431b5b" },
